import './App.css';
import React, { useEffect, useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { logout } from './redux/authActions';
import ClockInOut from './ClockInOut';
import UserProfile from './UserProfile';
import Login from './Login';

import {
    BarChart,
    Bar,
    XAxis,
    YAxis,
    CartesianGrid,
    Tooltip,
    Legend,
    ResponsiveContainer,
} from 'recharts';

function App() {
    const { user, isLoading, error } = useSelector((state) => state.auth);
    const dispatch = useDispatch();
    const [activeTab, setActiveTab] = useState('clock');
    const [workHours, setWorkHours] = useState({});

    useEffect(() => {
        if (user) {
            const simulateFetchWorkHours = async () => {
                await new Promise((resolve) => setTimeout(resolve, 500));
                setWorkHours({
                    Monday: 8,
                    Tuesday: 7,
                    Wednesday: 9,
                    Thursday: 8,
                    Friday: 7,
                    Saturday: 0,
                    Sunday: 0,
                    WeekTotal: 39,
                    BiweekTotal: 78,
                });
            };

            simulateFetchWorkHours();
        }
    }, [user]);

    const handleLogout = () => {
        dispatch(logout());
    };

    const handleTabChange = (tab) => {
        setActiveTab(tab);
    };

    const renderChart = () => {
        const data = Object.keys(workHours)
            .map((day) => ({ name: day, hours: workHours[day] }))
            .filter((item) => item.name !== 'WeekTotal' && item.name !== 'BiweekTotal');

        return (
            <ResponsiveContainer width="80%" height={300}>
                <BarChart
                    data={data}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip />
                    <Legend />
                    <Bar dataKey="hours" fill="#8884d8" />
                </BarChart>
            </ResponsiveContainer>
        );
    };

    if (!user) {
        return <Login />;
    }

    return (
        <div className="app-container">
            <header className="app-header">
                <h1 className="app-title">Clock In and Out App</h1>
                <div className="user-info">
                    <p>Welcome, {user.username}!</p>
                    <button onClick={handleLogout} className="logout-button">
                        Logout
                    </button>
                </div>
                {isLoading && <p>Loading...</p>}
                {error && <p style={{ color: 'red' }}>{error}</p>}
            </header>

            <main className="app-main">
                <nav className="tabs">
                    <button
                        className={`tab ${activeTab === 'clock' ? 'active' : ''}`}
                        onClick={() => handleTabChange('clock')}
                    >
                        Clock In/Out
                    </button>
                    <button
                        className={`tab ${activeTab === 'profile' ? 'active' : ''}`}
                        onClick={() => handleTabChange('profile')}
                    >
                        User Profile
                    </button>
                    <button
                        className={`tab ${activeTab === 'chart' ? 'active' : ''}`}
                        onClick={() => handleTabChange('chart')}
                    >
                        Work Hours Chart
                    </button>
                </nav>

                {activeTab === 'clock' ? (
                    <ClockInOut />
                ) : activeTab === 'profile' ? (
                    <UserProfile user={user} />
                ) : (
                    <div className="work-hours-chart">
                        <h2>Work Hours Biweekly Chart</h2>
                        {renderChart()}
                        <p>Total hours worked this week: {workHours.WeekTotal || 0}</p>
                        <p>Total hours worked this biweek: {workHours.BiweekTotal || 0}</p>
                    </div>
                )}
            </main>
        </div>
    );
}

export default App;
